import React from "react";
import UserLayout from "./userlayout";
import Head from "../components/Header/Head";
import { Row, Menu, Card, Button, Col } from "antd";
import Link from "next/link";

export default function shipping() {
  return (
    <div>
      {/* <UserLayout>

      </UserLayout> */}
      <Head />
      <Row>
        <h1>Encrypted checkout</h1>
      </Row>
      <Row>
        <Col span={12}>
          <Menu
            mode="horizontal"
            // style={{ boxShadow: "1px 4px 6px #888888", borderRadius: " 30px" }}
            //defaultSelectedKeys={["2"]}
          >
            <Menu.Item
              key="1"
              style={{ height: "58px" }}
              //onClick={handlemeal}
            >
              <h3>
                {" "}
                <a>1. shipping info</a>
              </h3>
            </Menu.Item>
            <Menu.Item
              key="2"
              style={{ height: "58px" }}
              //onClick={handlemeal}
            >
              <a>2. payment info</a>
            </Menu.Item>
          </Menu>
        </Col>
        <Col style={{ borderBottom: "1px solid green" }}>
          <h3>Shopping Cart</h3>
        </Col>
      </Row>
      <Row>
        <Col>
          <Card
            style={{
              borderLeft: "3px solid #74cf4e",
              // marginLeft: "550px",
              marginTop: "20px",
              width: "28%",
              marginLeft: "10px",
              marginTop: "20px",
            }}
          >
            <div>
              <h2>Home</h2>
              <h2>land mark</h2>
              <h3>pincode</h3>
              <Button
                type="primary"
                htmlType="submit"
                shape="round"
                style={{ backgroundColor: "#74cf4e", border: 0 }}
              >
                Delivery here
              </Button>
              <Button
                type="primary"
                htmlType="submit"
                shape="round"
                style={{
                  backgroundColor: "#74cf4e",
                  border: 0,
                  marginLeft: "193px",
                }}
              >
                Edit
              </Button>
            </div>
          </Card>
        </Col>
        <Col>
          <Card
            //onClick={showModal}
            hoverable
           // className="Styles.antCardBody"
            bodyStyle={{
              padding: "0",
              fontSize: "9px",
            }}
            style={{ width: 117, marginLeft: "20px" }}
            cover={<img alt="example" src="./images/plate.jpg" />}
          //  key={el._id}
          >
            <p>{el.menu}</p>
            <p>Special 1 plate</p>
          </Card>
        </Col>
      </Row>
    </div>
  );
}
